const axios = require('axios')

const user = {
    auth: async () => {
        const res = await axios.get('/users/')
        return res.data
    },
    signIn: async (email, password) => {
        const res = await axios.post('/users/sign-in', {email, password})
        return res.data
    },
    signUp: async (email, password, password2) => {
        const res = await axios.post('/users/sign-up', {email, password, password2})
        return res.data
    },
    signOut: async () => {
        const res = await axios.get('/users/sign-out')
        return res.data
    },
    delete: async () => {
        const res = await axios.get('/users/delete')
        return res.data
    },
}

module.exports = user
